import styles from './Home.module.css'
import React from 'react'
import logo from '../../img/logo.png';
import dots from '../../img/3dots.png'
import coursePic from '../../img/course.png'
import { useState, useRef, useEffect } from 'react';

export default function Home() {
    const [optionsVisible, setOptionsVisible] = useState(false);
    const optionsRef = useRef(null);

    // useEffect(() => {
    //     function handleClickOutside(event) {
    //         if (optionsRef.current && !optionsRef.current.contains(event.target)) {
    //             setOptionsVisible(false);
    //         }
    //     }

    //     document.addEventListener('click', handleClickOutside);
    //     return () => {
    //         document.removeEventListener('click', handleClickOutside);
    //     };
    // }, []);

    const toggleOptions = () => {
        setOptionsVisible(!optionsVisible);
    };
  return (
    <div className={styles.body}>
        <nav className={styles.nav}>
            <div className={styles.navitem1}>
                <img src={logo} alt="img" className={styles.img} />
                <h2>Welcome back, firstname lastname</h2>
            </div>
            <div>
                <button className={styles.button}>Logout</button>
            </div>
        </nav>

        <div className={styles.mainBody}>

            <h2 style={{ fontWeight:'bold', color: 'white' }}>Courses (4)</h2>
            
            <div className={styles.coursesBox}>

                <div className={styles.coursesItem}>
                    <div className={styles.coursesImageHolder}>
                        <img src={coursePic} alt='coursepic' width={250} height={250} className={styles.coursePic}/>
                        <img className={styles.dots} src={dots} alt='3dots' onClick={toggleOptions}/>
                        {optionsVisible && (
                            <div className={styles.options} ref={optionsRef}>
                                <ul>
                                    <li>Option 1</li>
                                    <li>Option 2</li>
                                </ul>
                            </div>
                        )}
                    </div>
                    <div style={{ color: 'white', paddingTop: 5 }}>Course 1</div>
                </div>

                <div className={styles.coursesItem}>
                    <div className={styles.coursesImageHolder}>
                        <img src={coursePic} alt='coursepic' width={250} height={250} className={styles.coursePic}/>
                        <img className={styles.dots} src={dots} alt='3dots'/>
                    </div>
                    <div style={{ color: 'white', paddingTop: 5 }}>Course 2</div>
                </div>

                <div className={styles.coursesItem}>
                    <div className={styles.coursesImageHolder}>
                        <img src={coursePic} alt='coursepic' width={250} height={250} className={styles.coursePic}/>
                        <img className={styles.dots} src={dots} alt='3dots'/>
                    </div>
                    <div style={{ color: 'white', paddingTop: 5 }}>Course 3</div>
                </div>

                <div className={styles.coursesItem}>
                    <div className={styles.coursesImageHolder}>
                        <img src={coursePic} alt='coursepic' width={250} height={250} className={styles.coursePic}/>
                        <img className={styles.dots} src={dots} alt='3dots'/>
                    </div>
                    <div style={{ color: 'white', paddingTop: 5 }}>Course 4</div>
                </div>
                
            </div>
        </div>
      
    </div>
  )
}
